My code creates a spreadsheet with a formula in cell B5, e.g. `=SUM(A1:A9)`. The xlsx created opend correctly in Excel and LibreOffice. However, opening it in Google Sheets, shows that B5 contains `==SUM(A1:A9)`, causing an error in parsing.

### Code
```csharp
using DocumentFormat.OpenXml;
using DocumentFormat.OpenXml.Packaging;
using DocumentFormat.OpenXml.Spreadsheet;

var fileName = "c:/tmp/test.xlsx";
using var spreadsheetDocument = SpreadsheetDocument.Create(fileName, SpreadsheetDocumentType.Workbook);
var workbookPart = spreadsheetDocument.AddWorkbookPart();
workbookPart.Workbook = new();
var sheets = workbookPart.Workbook.AppendChild(new Sheets());
var worksheetPartSummary = workbookPart.AddNewPart<WorksheetPart>();
worksheetPartSummary.Worksheet = new(new SheetData());
var sheetData = worksheetPartSummary.Worksheet.Elements<SheetData>().First();
var summary = new Sheet() { Id = workbookPart.GetIdOfPart(worksheetPartSummary), SheetId = 1, Name = "Summary" };
sheets.Append(summary);
var row5 = new Row { RowIndex = 5 };
var a5 = new Cell
{
    CellReference = new("A5"),
    DataType = CellValues.String,
    CellValue = new("Total:")
};
var b5 = new Cell { CellFormula = new("=SUM(B6:B11)") };
row5.Append(a5, b5);
sheetData.Append(row5);
```
Expected:
Opening in Google Sheets should have `=SUM(B6:B11)` in cell B5, as it does in opening in Excel
Actual:
Opening in Google Sheets has `==SUM(B6:B11)` in cell B5, unlike Excel

 - OS: Windows 11
 - .NET 8.0
 - DocumentFormat.OpenXml Version: 3.0.2

**Describe the bug**
With v3.0.2 AddWorkbookPart method is throwing exception - The specified package is invalid. The main part is missing.

